import React from 'react';

const Offers = () => {
  return <div className='max-w-[900px] mx-auto px=4 py-12 flex flex-wrap justify-between items-center gap-4 text-white'>
    <p className='bg-amber-500 px-4 py-2 rounded-full'>Booking Incentives</p>
    <p className='bg-amber-500 px-4 py-2 rounded-full'>Competitive Rates</p>
    <p className='bg-amber-500 px-4 py-2 rounded-full'>Book with Flexibility</p>
    <p className='bg-amber-500 px-4 py-2 rounded-full'>Trip Insurance</p>
  </div>;
};

export default Offers;
